import Container from 'react-bootstrap/Container';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSquareWhatsapp } from '@fortawesome/free-brands-svg-icons';
import { faSquareInstagram } from '@fortawesome/free-brands-svg-icons';
import { faSquareFacebook } from '@fortawesome/free-brands-svg-icons';
import { faSquareGithub } from '@fortawesome/free-brands-svg-icons';

function FooterComponent() {
    return (
        <footer className="py-5">
            <Container>
                <div className="row px-0">
                    <div className="col-12 col-md-6 pe-0 pe-md-5 ps-0">
                        <h6 className='display-6 fw-bolder underline w-max'>Contacts</h6>
                        <p className='lead my-3'>Feel free to contact me if you need assistance, collaboration or anything else! Please use the following contacts for professional purposes only and use social media for informal matters.</p>
                    </div>
                    <div className="col-12 col-md-6 ps-0 ps-md-5">
                        <h6 className='display-6 fw-bolder underline w-max'>Socials</h6>
                        <p className='lead my-3'>Get in touch with me and follow me on my socials so you don't miss my latest adventures!</p>
                        <div className='d-flex'>
                            <a className='pe-3 text-decoration-none text-dark display-6' href="https://wa.me/393396446669"><FontAwesomeIcon icon={faSquareWhatsapp} /></a>
                            <a className='pe-3 text-decoration-none text-dark display-6' href="https://www.instagram.com/matteomigliarese_/"><FontAwesomeIcon icon={faSquareInstagram} /></a>
                            <a className='pe-3 text-decoration-none text-dark display-6' href="https://www.facebook.com/matteo.migliarese.14"><FontAwesomeIcon icon={faSquareFacebook} /></a>
                            <a className='pe-3 text-decoration-none text-dark display-6' href="#"><FontAwesomeIcon icon={faSquareGithub} /></a>
                        </div>
                    </div>
                </div>
            </Container>
        </footer>
    );
}

export default FooterComponent;
